import { withRouter } from 'next/router';
import Layout from '../components/Layout';

const Post = withRouter((props) => {
    return (
        <Layout>
            <h3>My Blog</h3>
            <p>{ props.router.query.id }: { props.router.query.title }</p>
            <p>{ props.router.query.content }</p>
        </Layout>
    );
});

export default Post;
